import React, { Component } from "react";
import GenNavBar from "./GenNavBar";
import HeaderImages from "../images/header/HeaderImages";
import Grid from "@material-ui/core/Grid";
import HeaderContent from "./HeaderContent";

class HomePage extends Component {
  signInNav = () => {
    this.props.history.push("/signin");
  };

  signUpNav = () => {
    this.props.history.push("/signup");
  };

  render() {
    return (
      <div>
        <Grid
          container
          style={{
            background: "transparent",
          }}
        >
          <Grid item xs={12}>
            <GenNavBar
              signInNav={this.signInNav}
              signUpNav={this.signUpNav}
            ></GenNavBar>
          </Grid>
          <Grid
            item
            xs={12}
            style={{
              height: "35rem",
              background: "transparent",
            }}
          >
            <HeaderContent></HeaderContent>
          </Grid>
          <Grid
            item
            xs={12}
            style={{
              height: "10rem",
              backgroundColor: "white",
              background: "transparent",
            }}
          >
            <h2 style={{ color: "#2a6bf4" }}>Content</h2>
          </Grid>
          <Grid item xs={12} style={{ border: "1px solid red" }}>
            <div style={{ widht: "50%" }}>
              <HeaderImages image={"1"}></HeaderImages>
            </div>
            <div></div>
          </Grid>
          <Grid item xs={12} style={{ border: "1px solid blue" }}>
            <HeaderImages image={"2"}></HeaderImages>
          </Grid>
        </Grid>
      </div>
    );
  }
}

export default HomePage;
